import React, {useState } from 'react';
import { Link } from "react-router-dom"
import diya from './images/deewali.png';

import "./Navbar.css";
function Navbar() {
    const [isOpen, setIsOpen] = useState(false);
    return (
        <>
        <div className='Navbar'>
        <img src={diya} alt=""  height="150px" width="150px" /><p>Happy Deewali</p>
            <div className= {`nav-list ${isOpen && "open"}`}>
                <Link className="nav-items" to="/">Home</Link>
                <Link className="nav-items" to="/project">Projects</Link>
                <Link className="nav-items" to="/contact">Contact</Link>
            </div>
            <div className={`nav-toggle ${isOpen && "open"}`} onClick={() => setIsOpen(!isOpen)}>
                <div className='bar'></div>
            </div>
        </div>
        </>
    )
}

export default Navbar
